const express = require('express'); //Import du module
const cors = require('cors');

let corsOptions = [ //Configuration du cors
    origin = '*'
];

const app = express(); //Initialisation du module express
app.use(cors(corsOptions)); //Utilisation du module cors par express
app.listen(3000); // Mise en écoute du serveur

// USERS
app.get('/users', function(req, res) {
    res.send(users);
})

app.get('/users/:id', function(req, res) {
  let id = req.params.id; // La requête envoie un paramètre qui s'appelle id

  for (let i = 0; i < users.length; i++) {
    let currentUser = users[i]; 
    if(currentUser.id == id) { // On vérifie que l'id du user de l'api correspond bien à l'id du user envoyé en requête
      res.send(currentUser);
      break; // Si oui on sors de la fonction et on passe à la suite
    }
  }
res.statusMessage = "User not found";
res.status(404).end(); // On renvoie le status correspondant et on met fin à la requête
})

//RECIPES
app.get('/recipes', function(req, res) {
  res.send(recipes);
})

app.get('/recipes/:recipe_id', function(req, res) {
  let recipeId = req.params.recipe_id; // La requête envoie un paramètre qui s'appelle id

  for (let i = 0; i < recipes.length; i++) {
    let currentRecipe = recipes[i]; 
    if(currentRecipe.recipe_id == recipeId) { // On vérifie que l'id du user de l'api correspond bien à l'id du user envoyé en requête
      res.send(currentRecipe);
      break; // Si oui on sors de la fonction et on passe à la suite
    }
  }
res.statusMessage = "Recipe not found";
res.status(404).end(); // On renvoie le status correspondant et on met fin à la requête
})
